import './App.css';
import React, { useState } from 'react';
import NumberSquare from './components/NumberSquare';


const App = () => {


  const [gridSize, setGridSize] = useState(0)
  const [grid, setGrid] = useState([])


  const generateGrid = () => {
    let x = new Array(20).fill(<NumberSquare />)
    setGrid(x);

  }

  return (
    <div className="App">
      <div className="headers">
        Sieve of Eratosthenes
      </div>
      <div className="inputs">
        <input type="number" value={gridSize} onChange={e => setGridSize(e.target.value)} />
        <button className="GenerateButton" onClick={generateGrid}>Generate</button>

      </div>
      <div className="grid">
        {grid.map((number, index) => {
          return (number)
        })}

      </div>

    </div>
  );
}

export default App;
